export const initialState = {
    username: '',
    password: '',
    email: ''
}

const CONSTANT = {
    USERNAME: 'username',
    PASSWORD: 'password',
    EMAIL: 'email'
}
export const reducer = (state, action) => {
    switch (action.type) {
        case CONSTANT.USERNAME:
            console.log({ ...state, username: state.username })
            break;
        case CONSTANT.PASSWORD:
            console.log({ ...state, username: state.username })
            break;
        case CONSTANT.EMAIL:
            console.log({ ...state, username: state.username })
            console.log('object')
            break;
        default:
            console.log('object')
    }
}
